import React from 'react';
import ReactDom from 'react-dom';

function Greeting() {
  return (
    <div>
      <Person />
      <ul>
        <li>
          <a href='#'>Hello World</a>
        </li>
        <img src type='text' name='' id='' />
      </ul>
    </div>
  );
}

const Person = () => <h1>Hey</h1>;

ReactDom.render(<Greeting />, document.getElementById('root'));
